import React from 'react';
import styled from "styled-components";

export const Pic = styled.img`
  width: 5vw;
  height: 10vh;
  border-radius: 70%;
`;

const Profile = () => {
  return (
    <div>

      <Pic src="/images/profile.png" />

    </div>
  );
};

export default Profile;
